// src/components/TelaInicial/TelaInicial.tsx
import React from "react";
import { Link } from 'react-router-dom'
import Atendimentos from "../../layouts/Atendimentos";
import Prontuarios from "../../layouts/Prontuarios";
import AreaPaciente from ".";
import Agenda from "./Agenda";
import Profissionais from "./Profissionais";
import Servicos from "./Servicos";
import "./TelaInicial.css";
import '../../css/telaInicial.css';

const TelaInicial: React.FC = () => {
  return (
    <div>
      <h1>Clínica Médica</h1>
      <header>
        <h1>Clínica Médica </h1>
        <nav>
          <Link to="/tela-inicial">Home</Link>
          <Link to="/atendimentos">Atendimentos</Link>
          <Link to="/prontuarios">Prontuários</Link>
          <Link to="/area-paciente">Área do Paciente</Link>
          <Link to="/agenda">Agenda</Link>
          <Link to="/profissionais">Profissionais</Link>
          <Link to="/servicos">Serviços</Link>
        </nav>
      </header>

      <section>
        <h2>Atendimentos</h2>
        {/* Conteúdo da seção de Atendimentos */}
      </section>

      <section>
        <h2>Prontuários</h2>
        {/* Conteúdo da seção de Prontuários */}
      </section>

      <section>
        <h2>Área do Paciente</h2>
        {/* Conteúdo da seção da Área do Paciente */}
      </section>

      <section>
        <h2>Agenda</h2>
        {/* Conteúdo da seção da Agenda */}
      </section>

      <section>
        <h2>Profissionais</h2>
        {/* Conteúdo da seção de Profissionais */}
      </section>

      <section>
        <h2>Serviços</h2>
        {/* Conteúdo da seção de Serviços */}
      </section>
    </div>
  );
};

export default TelaInicial;
